			return DateTime.Parse(Convert.ToDateTime(date, System.Globalization.CultureInfo.CurrentCulture).ToString(System.Globalization.CultureInfo.InvariantCulture.DateTimeFormat.ShortDatePattern));
		}

		private DateTime ParseDate(string date)
		{
			return DateTime.ParseExact(date, "M/d/yyyy", System.Globalization.CultureInfo.InvariantCulture);
		}

		private decimal ParseDecimal(string num)
		{
			return decimal.Parse(num, System.Globalization.CultureInfo.InvariantCulture);
		}
		private Single ParseSingle(string num)
		{
			return Single.Parse(num, System.Globalization.CultureInfo.InvariantCulture);
		}

